function PrivateServicesPage() {
  const [privateServices, setPrivateServices] = useState([]);
  const servicesRef = useRef(collection(db, "services"));

  useEffect(() => {
    const getPublicServices = async () => {
      try {
        const data = await getDocs(
          servicesRef.current,
          where("isPublic", "==", false)
        );
        const filteredData = data.docs.map((doc) => ({
          ...doc.data(),
          id: doc.id,
        }));
        console.log(filteredData);
        setPrivateServices(filteredData);
        console.log(data);
      } catch (err) {
        console.error(err);
      }
    };
    getPublicServices();
  }, [servicesRef]);

  return (
    <div>
      <ServiceNavigation />
      <div className="publicServDisplay">
        {privateServices.map((card, i) => {
          return (
            <NavLink to="/private-list" key={i}>
              <ServiceCard type={card.type} src={card.src} />;
            </NavLink>
          );
        })}
      </div>
    </div>
  );
}

export default PrivateServicesPage;
